INSERT INTO `feedback_info` VALUES (5,2,1,'지난달보다 독해 성적이 많이 올랐네요. 시간 조절만 좀 더 잘하면 될 것 같아요.','2023-03-22 16:30:27','2023-03-22 16:30:27',1,'박진혁 학생 독해 피드백 입니다.'),(6,2,78,'어휘 성적이 많이 부족해요. 단어를 좀 더 외우도록 하세요.','2023-03-22 16:38:04','2023-03-22 16:38:04',1,'박진혁 학생 어휘 피드백 입니다.'),(7,2,82,'기본적인 문법을 다시 공부하도록 하세요.','2023-03-22 16:39:16','2023-03-22 16:39:16',1,'박진혁 학생 문법 피드백 입니다.'),(8,5,93,'듣기 성적이 많이 올랐어요. 하루에 10분씩 투자해서 예/복습하도록 하세요.','2023-03-22 16:41:02','2023-03-22 16:41:02',1,'이도영 학생 듣기 피드백 입니다.'),(9,5,78,'하루에 단어 100개씩 외우고 전 날 외운 것도 복습하세요.','2023-03-22 16:43:05','2023-03-22 16:43:05',1,'이도영 학생 어휘 피드백 입니다.'),(10,5,82,'문법 성적이 떨어졌네요. 안일하게 생각하지 말고 알던 문법도 다시 복습하도록 하세요.','2023-03-22 16:44:54','2023-03-22 16:44:54',1,'이도영 학생 문법 피드백 입니다.'),(11,30,6,'독해 시험 100점을 축하합니다. 하루에 3문항씩 꾸준히 풀어보세요.','2023-03-22 16:46:32','2023-03-22 16:46:32',1,'김경훈 학생 독해 피드백 입니다.'),(12,30,94,'듣기 성적이 다른 과목 점수보다 낮아요. 많은 문제를 풀어보도록 하세요. ','2023-03-22 16:47:50','2023-03-22 16:47:50',1,'김경훈 학생 듣기 피드백 입니다.'),(13,30,79,'어휘는 항상 성적이 좋네요. 꾸준하게 잘 외워오는 모습 보기 좋아요.','2023-03-22 16:48:53','2023-03-22 16:48:53',1,'김경훈 학생 어휘 피드백 입니다.'),(14,31,79,'지난달보다 어휘테스트 결과가 좋지 않네요. 복습을 더 열심히 하도록 하세요.','2023-03-22 16:51:03','2023-03-22 16:51:03',1,'이정윤 학생 어휘 피드백 입니다.'),(15,55,95,'듣기 성적이 꾸준하게 상승하고 있네요. 하루에 10분씩 듣기 연습을 하세요.','2023-03-22 16:53:05','2023-03-22 16:53:05',1,'김혜민 학생 듣기 피드백 입니다.'),(16,56,84,'문법이 다른 과목에 비해 많이 약해요. 기본적인 문법 공부를 더 하세요.','2023-03-22 16:54:21','2023-03-22 16:54:21',1,'김재성 학생 문법 피드백 입니다.'),(17,90,77,'독해 점수는 항상 높네요. 매일 3문항씩 풀고 해석해보세요.','2023-03-22 16:56:26','2023-03-22 16:56:26',1,'강수경 학생 독해 피드백 입니다.'),(18,91,81,'항상 열심히 하는 모습 보기 좋아요. 성적도 점점 좋아지고 있네요. 외웠던 단어도 지나치지 말고 복습하세요.','2023-03-22 16:59:17','2023-03-22 16:59:17',1,'박정훈 학생 어휘 피드백 입니다.'),(19,28,1,'독해 성적이 낮네요.','2023-03-23 14:38:23','2023-04-04 17:44:10',1,'안녕하세요'),(65,29,1,'독해 성적 많이 올랐네요. 이대로만 쭉 가면 될 것 같아요. 아쉽게 놓치는 문제들 보완해봅시다.','2023-04-04 17:53:32','2023-04-04 17:53:32',1,'문재현 학생 독해 피드백 입니다.');
